import React from 'react';
import PropTypes from 'prop-types';
import bemCl from 'bem-cl';
import { Button } from '@vkontakte/vkui';
import {
    Icon28CameraOutline,
    Icon28FavoriteOutline,
    Icon28PhoneOutline,
    Icon28ShareOutline,
    Icon28UnfavoriteOutline,
} from '@vkontakte/icons';
import HorizontalScrollGroup from '../HorizontalScrollGroup/HorizontalScrollGroup';
import { withNavigation } from '../../containers/HOC/withNavigation';
import { MODALS_ID } from '../../constants/modals';
import { ShareRepetitor, ShowStoryBox } from '../../bridge';
import { APP_ID } from '../../constants';
import { isApp, isDesktop, isMVK } from '../../utils';
import './style.scss';

const b = bemCl('teacher-card-actions');

const TeacherCardActions = ({ teacher, favoriteTeachers, addFavorite, deleteFavorite, ...navigationParams }) => {
    const { setActiveModal } = navigationParams;

    const isFavorite = React.useMemo(
        () => favoriteTeachers.find(item => item.id === teacher.id) !== undefined,
        [teacher, favoriteTeachers]
    );

    const handleClickFavorite = React.useCallback(() => {
        if (isFavorite) {
            deleteFavorite(teacher.id);
        } else {
            addFavorite(teacher.id);
        }
    }, [isFavorite, teacher, deleteFavorite, addFavorite]);

    const handleClickShareRepetitor = React.useCallback(() => {
        ShareRepetitor(teacher.id);
    }, [teacher]);

    const handleClickStory = React.useCallback(() => {
        const stickers = [];
        stickers.push({
            sticker_type: 'renderable',
            sticker: {
                transform: {
                    translation_y: 0.08,
                    relation_width: 0.55,
                    gravity: 'center_top',
                },
                can_delete: 0,
                content_type: 'image',
                blob: 'data:image/png;base64,',
                clickable_zones: [
                    {
                        action_type: 'app',
                        action: {
                            app_id: APP_ID,
                            app_context: `teacher=${teacher.id}`,
                        },
                        clickable_area: [
                            {
                                x: 0,
                                y: 0,
                            },
                            {
                                x: 650,
                                y: 0,
                            },
                            {
                                x: 650,
                                y: 550,
                            },
                            {
                                x: 0,
                                y: 550,
                            },
                        ],
                    },
                ],
            },
        });

        ShowStoryBox(teacher.id, stickers);
    }, [teacher]);

    const handleClickCall = React.useCallback(
        e => {
            setActiveModal(MODALS_ID.ORDER, { teacher: teacher });
        },
        [teacher, setActiveModal]
    );

    return !isApp() ? (
        <HorizontalScrollGroup>
            {!isMVK() && !isDesktop() && (
                <Button
                    mode="tertiary"
                    stretched
                    size="m"
                    className={b('button').toString()}
                    onClick={handleClickStory}
                >
                    <div className={b('icon')}>
                        <Icon28CameraOutline />
                        <div>История</div>
                    </div>
                </Button>
            )}
            {isDesktop() && (
                <Button mode="tertiary" stretched size="m" className={b('button').toString()} onClick={handleClickCall}>
                    <div className={b('icon')}>
                        <Icon28PhoneOutline />
                        <div>Телефон</div>
                    </div>
                </Button>
            )}
            <Button
                mode="tertiary"
                stretched
                size="m"
                className={b('button').toString()}
                onClick={handleClickShareRepetitor}
            >
                <div className={b('icon')}>
                    <Icon28ShareOutline />
                    <div>Поделиться</div>
                </div>
            </Button>
            <Button mode="tertiary" stretched size="m" className={b('button').toString()} onClick={handleClickFavorite}>
                <div className={b('icon')}>
                    {isFavorite ? <Icon28UnfavoriteOutline /> : <Icon28FavoriteOutline />}
                    <div>Избранное</div>
                </div>
            </Button>
        </HorizontalScrollGroup>
    ) : null;
};

TeacherCardActions.propTypes = {
    teacher: PropTypes.object.isRequired,
    favoriteTeachers: PropTypes.array.isRequired,
    addFavorite: PropTypes.func.isRequired,
    deleteFavorite: PropTypes.func.isRequired,
};

export default withNavigation(TeacherCardActions);
